import { Link } from 'react-router-dom';

export const Navbar = () => {
    return (
        <nav className="nav">
            <a href="/" className="site-title">Dirty Soles</a>
            <ul>
                <li>Home</li>
                <li>Products</li>
                <li>About</li>
                <li>Contact Us</li>
                <li>Admin</li>
            </ul>
        </nav>
    )
};
